import Slider from 'react-slick'
import styles from './styles.module.css'
import {useRef, useState} from 'react'
import TeamMember from '../TeamMember/TeamMember.js'

function get_item(obj, id) {
	return <TeamMember 
				imgPath={obj['photo']} 
				fullName={obj['full-name']}
				gitHub={obj['gitHub']}
				telegram={obj['telegram']}
				text={obj['description']}
				devStack={obj['dev-stack']}/>
}

function mod(a, b) {
	if (a >= 0)
		return a % b;
	else {
		return (b - ((-a) % b)) % b
	}
}

function Team(props) {

	const  slideCards = [
		{
			'full-name': "Алеша попович",
			'photo': "./img/person-photo.png",
			'description': "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec vel ligula vel leo commodo dapibus eu vel justo. Vivamus non odio mauris. Ut ornare tempus tincidunt. Duis quis nibh eget.",
			'dev-stack': [
				"HTML",
				"CSS",
				"JavaScript",
				"React"
			],
			'gitHub': "",
			'telegram': ""
		},
		{	
			'full-name': "Никита Васин",
			'photo': "./img/person-photo.png",
			'description': "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec vel ligula vel leo commodo dapibus eu vel justo. Vivamus non odio mauris. Ut ornare tempus tincidunt. Duis quis nibh eget.",
			'dev-stack': [
				"HTML",
				"CSS",
				"JavaScript",
				"React"
			],
			'gitHub': "",
			'telegram': ""
		},
		{
			'full-name': "Алексей Васькин",
			'photo': "./img/person-photo.png",
			'description': "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec vel ligula vel leo commodo dapibus eu vel justo. Vivamus non odio mauris. Ut ornare tempus tincidunt. Duis quis nibh eget.",
			'dev-stack': [
				"HTML",
				"CSS",
				"JavaScript",
				"React"
			],
			'gitHub': "",
			'telegram': ""
		},
		{
			'full-name': "Алеша попович",
			'photo': "./img/person-photo.png",
			'description': "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec vel ligula vel leo commodo dapibus eu vel justo. Vivamus non odio mauris. Ut ornare tempus tincidunt. Duis quis nibh eget.",
			'dev-stack': [
				"HTML",
				"CSS",
				"JavaScript",
				"React"
			],
			'gitHub': "",
			'telegram': ""
		},
		{	
			'full-name': "Никита Васин",
			'photo': "./img/person-photo.png",
			'description': "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec vel ligula vel leo commodo dapibus eu vel justo. Vivamus non odio mauris. Ut ornare tempus tincidunt. Duis quis nibh eget.",
			'dev-stack': [
				"HTML",
				"CSS",
				"JavaScript",
				"React"
			],
			'gitHub': "",
			'telegram': ""
		},
		{
			'full-name': "Алексей Васькин",
			'photo': "./img/person-photo.png",
			'description': "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec vel ligula vel leo commodo dapibus eu vel justo. Vivamus non odio mauris. Ut ornare tempus tincidunt. Duis quis nibh eget.",
			'dev-stack': [
				"HTML",
				"CSS",
				"JavaScript",
				"React"
			],
			'gitHub': "",
			'telegram': ""
		},
	]



	const sliderRef = useRef(null)
	const [slide, setSlide] = useState(0)

	function SampleNextArrow(props) {
		const {styles, img_path} = props
		return <>
		 		<button className={styles.nextBtn + " slick-arrow slick-next"} onClick = {() => {
		 			setSlide(mod(slide + 1, slideCards.length / 3))
		 			sliderRef.current.slickNext()
		 		}}>
			 		<div className={styles.imgBlock}>
		 				<img src={img_path} alt=""/>
		 			</div>
				</button>
			</>
	}

	function SamplePrevArrow(props) {
		const {styles, img_path} = props
		return <>
				<button className={styles.prevBtn}>
					<div className={styles.imgBlock} onClick = {() => {
							setSlide(mod(slide - 1, slideCards.length / 3))
							sliderRef.current.slickPrev()
						}}>
		 				<img src={img_path} alt=""/>
		 			</div>
				</button>
			</>
	}

	const sliderConfigs = {
		slidesToShow: 3,
    	slidesToScroll: 3,
    	speed: 200,
    	infinite: false,
    	arrows: true,
    	infinite: true,
    	nextArrow: SampleNextArrow({"styles":styles, "img_path":"../../../next-arrow.svg"}),
    	prevArrow: SamplePrevArrow({"styles":styles, "img_path":"../../../prev-arrow.svg"})
	}

	console.log(styles)

	const segment_pos_and_width = {
		width: `${100 / (slideCards.length / 3)}%`,
		left: `${100 * slide / (slideCards.length / 3)}%`
	}

	return <div className={styles.slider}>
			<h1 className={styles.title}>Наша команда</h1>
			<Slider {...sliderConfigs} ref={sliderRef}>
				{slideCards.map(get_item)}
			</Slider>
			<div className={styles.line}>
				<div className={styles.segment} 
					style={segment_pos_and_width}>
				</div>
			</div>
		</div>
}

export default Team
